import React, { Component } from 'react';
import 'materialize-css';
import { Button, Card, Row, Col} from 'react-materialize';

const options = [
  { value: 'HIRO', label: 'Hiro' },
  { value: 'JACKIE', label: 'Jackie' },
  { value: 'SHORTS', label: 'Shorts' }
]

class RightParticipantDropdown extends Component {
  render() {
    return (
      <Select
        id="rightParticipants"
        multiple
        name="rightParticipants"
        options={{
          alignment: 'right',
          autoTrigger: true,
          closeOnClick: true,
          constrainWidth: true,
          container: null,
          coverTrigger: true,
          hover: false,
          inDuration: 150,
          onCloseEnd: null,
          onCloseStart: null,
          onOpenEnd: null,
          onOpenStart: null,
          outDuration: 250
        }}
        value={['']}
      >
        <option
          disabled
          value=""
        >
          Choose Right Participant(s)
        </option>
        <option value="HIRO">
          HIRO
        </option>
        <option value="JACKIE">
          JACKIE
        </option>
        <option value="SHORTS">
          SHORTS
        </option>
      </Select>
    )
  }
};

export default RightParticipantDropdown;
